import React from 'react'
import styled from 'styled-components';
import './WhoComponent.css';
import ParallaxImage from '../WhoComponent/ParallexImage'

const Section=styled.div`
height:100vh;
background-color:red;
scroll-snap-align:center;
overflow: hidden;
`;




const WhoComponent = () => {

  return (
    <Section>
<div class="parallax-container">
    <div class="parallax-image" style="background-image: url(../../../Assets/image1.jpg);"></div>
    <div class="parallax-image" style="background-image: url(../../../Assets/image2.jpg);"></div>
    <div class="parallax-image" style="background-image: url('path/to/image3.jpg);"></div>
    <div class="parallax-image" style="background-image: url('path/to/image4.jpg);"></div>
  </div>
    </Section>
  )
}

export default WhoComponent
